        setState('Nothing much')
    }

    return (<>
        <div className="col-lg-10">
            <div className="my-4">
                <h1 className="h6">{state}</h1>
                <button className="btn btn-warning" onClick={clickHandler}>Click me</button>
            </div>
        </div>
    </>)
}

export default Dashboard
